syntax = "proto3";
package test;
service Test {
  rpc readValue(Noop) returns(FromId) {}
  rpc updateValue(Noop) returns(FromRef) {}
}
message FromId {
  To data = 1;
}
message FromRef {
  repeated Target data = 1;
}
message To {
  required string prop = 1;
}
message Target {
  double value = 1;
}
message Model {
  int32 noop = 1;
}
